/**
  * @brief     Obtain the current time as a string with the format "H:M:S".
  * @return    The current time as a string.
  */
std::string get_time(){
  auto t = std::time(nullptr);
  auto tm = *std::localtime(&t);
  std::stringstream ss;
  ss << std::put_time(&tm, "%H:%M:%S");
  return ss.str();
}

